select t.tr_volgnummer, t.tr_transnummer, t.tr_rel1, t.tr_rel2, t.tr_rel1_rek1, t.tr_rel1_rek2, t.tr_rel1_rek2_munts, t.tr_vruchtrelatie, t.tr_prijs_tr_mntsrt, t.tr_trans_munts, b.be_aantal_cijfers_display, b.be_bi_nummer, b.be_prijs_factor, t.tr_aantal, t.tr_transdatum, t.tr_exerciseprijs, t.tr_expiratiedatum, t.tr_optietype, t.tr_symbool, t.tr_context_enum, t.tr_mut_gemaakt, t.tr_indicatie, t.tr_mutatiecode, c.cl_naam1
/* Use this query for not or incomplete transactions and no account-filter applied. Use Unbooked relAccountInfo when an account filter is applied. */ from tv_transactions_in_progress trip inner join transactions t on t.tr_volgnummer = trip.trip_tr_volgnummer inner join beleggingsinstrument b on t.tr_symbool = b.be_symbool and t.tr_optietype = b.be_optietype and t.tr_expiratiedatum = b.be_expiratiedatum and t.tr_exerciseprijs = b.be_exerciseprijs inner join clienten c on c.cl_nummer = t.tr_rel1 :21 -- inner join transorin_orderorin_vw tov on tov.transaction_orin_id = t.tr_orin_id where 1=1 and trip.trip_tr_volgnummer <= ~1 and (:2=0 or (t.tr_boekdatum between ~3 and ~4)) and (:5=0 or (t.tr_transdatum between ~6 and ~7)) :8 -- tr_indication in ('K'...'O-G' and (:9=0 or (t.tr_ordernr_ordsubnr between ~10 and ~11)) and (:12=0 or trip.trip_tr_be_volgnummer = ~13) and (:14 = 0 or (trip.trip_tr_terminalnummer = ~15)) and (:16=0 or (t.tr_context_enum = ~17)) and (:18=0 or (t.tr_mutatiecode = ~19)) and ((:20 = 0 and trip_tr_status = 0) or trip.trip_tr_status > 0) :22 -- and tov.order_orin_id = :OrderOringId
order by trip.trip_tr_volgnummer desc fetch first ~23 rows only
